import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import Registration from './registrationPage';
import OpenEye from '../SvgIcons/eye-regular.svg';
import CloseEye from '../SvgIcons/eye-slash-regular.svg';

class Login extends Component {
  //login menu
  //meet authorization by 64 bits
  //transfer
  render(){
    return(
      <div>
        <form>
          <input className='loginBox' type='text' placeholder='Enter your username' />
          <input className='loginPw' type='text' placeholder='Enter your password' />
          <button className='togglePeek' ><img src={OpenEye} /></button>
          <br/>
          <Link to={'/MainPage/ShortIntro'}><button className='login-btn login-draw-border'>Enter</button></Link>
        </form>
        <Registration />
      </div>
    );
  }
}

export default Login;
